import React, { useEffect, useState } from "react";
import { MapContainer, TileLayer, Marker } from "react-leaflet";
import "leaflet/dist/leaflet.css";
import L from "leaflet";
import Papa from "papaparse";

// Fix default marker icons
delete L.Icon.Default.prototype._getIconUrl;
L.Icon.Default.mergeOptions({
  iconRetinaUrl: require("leaflet/dist/images/marker-icon-2x.png"),
  iconUrl: require("leaflet/dist/images/marker-icon.png"),
  shadowUrl: require("leaflet/dist/images/marker-shadow.png"),
});

const CENTER = { lat: 14.1467, lng: 121.4708 };

export default function MapPage() {
  const [spots, setSpots] = useState([]);
  const [selectedSpot, setSelectedSpot] = useState(null);

  useEffect(() => {
    fetch("/data/spots.csv")
      .then((res) => res.text())
      .then((csvText) => {
        Papa.parse(csvText, {
          header: true,
          skipEmptyLines: true,
          complete: (results) => {
            const rows = results.data
              .filter((r) => r.name && r.lat && r.lng)
              .map((r) => ({
                name: r.name,
                lat: parseFloat(r.lat),
                lng: parseFloat(r.lng),
                description: r.description || "No description available",
                visitors: r.visitors || "Moderate",
                tags: r.tags ? r.tags.split(",").map((t) => t.trim()) : [],
                image: r.image
                  ? `/images/${r.image.replace(/^\/+/, "").split("/").pop()}`
                  : null,
              }));
            setSpots(rows);
          },
        });
      });
  }, []);

  return (
    <div
      style={{
        display: "flex",
        height: "90vh",
        width: "100%",
        background: "#f9fafb",
      }}
    >
      {/* Map Section */}
      <div
        style={{
          flex: selectedSpot ? 1 : "100%",
          transition: "flex 0.3s ease",
          borderRadius: "12px",
          overflow: "hidden",
        }}
      >
        <MapContainer
          center={CENTER}
          zoom={13}
          style={{ height: "100%", width: "100%" }}
        >
          <TileLayer
            attribution='&copy; <a href="https://www.openstreetmap.org/">OSM contributors</a>'
            url="https://{s}.tile.openstreetmap.org/{z}/{x}/{y}.png"
          />
          {spots.map((spot, i) => (
            <Marker
              key={i}
              position={[spot.lat, spot.lng]}
              eventHandlers={{ click: () => setSelectedSpot(spot) }}
            />
          ))}
        </MapContainer>
      </div>

      {/* Info Panel */}
      {selectedSpot && (
        <div
          style={{
            width: "35%",
            background: "white",
            padding: "20px",
            overflowY: "auto",
            borderLeft: "1px solid #e5e7eb",
            boxShadow: "-4px 0px 12px rgba(0,0,0,0.08)",
            display: "flex",
            flexDirection: "column",
            position: "relative",
          }}
        >
          {/* Close Button */}
          <button
            onClick={() => setSelectedSpot(null)}
            style={{
              position: "absolute",
              top: "15px",
              right: "15px",
              background: "#ef4444",
              color: "white",
              border: "none",
              borderRadius: "50%",
              width: "32px",
              height: "32px",
              fontSize: "16px",
              fontWeight: "bold",
              cursor: "pointer",
              boxShadow: "0 2px 6px rgba(0,0,0,0.15)",
            }}
          >
            âœ•
          </button>

          {/* Banner Image (horizontal style) */}
          {selectedSpot.image && (
            <img
              src={selectedSpot.image}
              alt={selectedSpot.name}
              style={{
                width: "100%",
                height: "160px", // shorter, more like banner
                objectFit: "cover",
                borderRadius: "10px",
                marginBottom: "15px",
                boxShadow: "0 4px 10px rgba(0,0,0,0.1)",
              }}
            />
          )}

          {/* Title */}
          <h2
            style={{
              fontSize: "1.5rem",
              fontWeight: "700",
              color: "#111827",
              marginBottom: "10px",
              lineHeight: "1.3",
            }}
          >
            {selectedSpot.name}
          </h2>

          {/* Visitors */}
          <p
            style={{
              fontSize: "0.95rem",
              color: "#374151",
              marginBottom: "8px",
            }}
          >
            <strong style={{ color: "#111827" }}>Visitors:</strong>{" "}
            {selectedSpot.visitors}
          </p>

          {/* Description */}
          <p
            style={{
              fontSize: "0.95rem",
              color: "#4b5563",
              lineHeight: "1.5",
              marginBottom: "12px",
            }}
          >
            {selectedSpot.description}
          </p>

          {/* Tags */}
          {selectedSpot.tags.length > 0 && (
            <p
              style={{
                fontSize: "0.9rem",
                color: "#374151",
                background: "#f3f4f6",
                padding: "10px",
                borderRadius: "8px",
                lineHeight: "1.4",
              }}
            >
              <strong>Tags:</strong> {selectedSpot.tags.join(", ")}
            </p>
          )}
        </div>
      )}
    </div>
  );
}
